import React, { Component } from 'react';
import logo from './logo.png';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} />
          <p>
            Issue and verify digital certificates with ethereum smart contracts
          </p>
            Learn React
        </header>
      </div>
    );
  }
}

export default App;
